import { PieChart } from 'react-minimal-pie-chart';
import React from 'react'

const labels = ["January", "February", "March", "April"];
const data = {
  labels: labels,
  datasets: [
    {
      label: "My First dataset",
      backgroundColor: [
        'rgb(255, 99, 132)',
        'rgb(54, 162, 235)',
        'rgb(255, 205, 86)'
      ],
  
      borderColor: "rgb(,0,255)",
      data: [0, 10, 5, 2, 20, 30, 45],
      radius:200
    },
  ],
};
const Pie = () => {
  return (
    <div>
        <PieChart
  data={data}
/>;
    </div>
  )
}

export default Pie
